import React, { useState } from "react";
import { elements } from "./_color";

const ColorCodes = ({ toShowEls }) => {
  // const [colorMap, setColorMap] = useState([]);
  return (
    <div>
      {elements
        .filter((i) => {
          if (i in toShowEls) {
            return true;
          } else {
            return false;
          }
        })
        .map((i) => {
          return (
            <h3 key={i["symbol"]} style={{ color: "#" + i["cpk-hex"] }}>
              {i["name"]}
            </h3>
          );
        })}
    </div>
  );
};

export default ColorCodes;
